import React from "react";
const style = {
    position: 'absolute',
    top: 0,
    left: 0,
    backgroundColor: "#ccc"
}

const Loading = (props) => {
    return (
        <h1 className={style}>Loading!!!!</h1>
    )
}

export default Loading;
